import React from "react";
import '../styles/elementCard.css'

function ElementCard({selectedElement}) {
    return ( 
       <div id="singleCard">
              <h1 id="selectedAtomicMass">{selectedElement.atomicMass}</h1>
              <h1 id="selectedElementSymbol">{selectedElement.symbol}</h1>
              <h5 id="selectedName">{selectedElement.name}</h5>
       </div>
     );
}

export default ElementCard;
